Create a JavaScript program that allows users to draw on an HTML5 canvas
model
```javascript
const canvas = document.getElementById('canvas');
const ctx = canvas.getContext('2d');

let isDrawing = false;
let x = 0;
let y = 0;

canvas.addEventListener('mousedown', (e) => {
  isDrawing = true;
  x = e.clientX;
  y = e.clientY;
});

canvas.addEventListener('mousemove', (e) => {
  if (isDrawing) {
    let dx = e.clientX - x;
    let dy = e.clientY - y;
    x = e.clientX;
    y = e.clientY;

    ctx.beginPath();
    ctx.moveTo(x - dx, y - dy);
    ctx.lineTo(x, y);
    ctx.stroke();
  }
});

canvas.addEventListener('mouseup', () => {
  isDrawing = false;
});
```

**HTML:**

```html
<!DOCTYPE html>
<html>
  <head>
    <script src="script.js"></script>
  </head>

  <body>
    <canvas id="canvas" width="500" height="500"></canvas>
  </body>
</html>
```

**Explanation:**

* The `canvas` element is created and its context is retrieved.
* The `isDrawing` flag is used to track whether the user is currently drawing.
* The `x` and `y` variables store the mouse position.
* The `mousedown` event listener starts the drawing process when the mouse is clicked.
* The `mousemove` event listener draws a line from the previous mouse position to the current position.
* The `mouseup` event listener stops the drawing process when the mouse is released.
