* The `ctx.moveTo()` method sets the starting point of the path.
* The `ctx.lineTo()` method adds a line to the path.
* The `ctx.stroke()` method draws the path.

**Notes:**

* You can change the `width` and `height` of the canvas element in the HTML code.
