* The code defines an upload directory called `uploads/`.
* It allows only file types `jpg`, `jpeg`, `png`, and `gif`.
* It checks if the file size is within the allowed limit of 2 MB.
* It moves the uploaded file from the temporary location to the target directory.
* It prints a success message with the target file path.

**Additional Notes:**

* You need to create the `uploads` directory on your server.
* You can customize the allowed file types as needed.
* You can also set a maximum file size limit.
* Make sure your server has the necessary extensions for file uploads.

